  false,\n\t\"url\": null,\n\t\"notes\": \"Summary of waterfowl identification workshops
  conducted by Upper Souris National Wildlife Refuge and J. Clark Salyer National
  Wildlife Refuge.  Objectives of the workshops were to provide waterfowl hunters
  with a chance to become more knowledgeable in duck identification, make hunters
  more aware of regulations and changes for 1982, and to give the Fish and Wildlife
  Service a chance to display ideas, techniques, and purposes of managing waterfowl.
  \ This report includes a workshop agenda, conclusion of outcomes from the workshop,
  and attachments of workshop materials.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
